import React, { Component } from "react";
import Item from "../Item";
import "./index.css";
export default class List extends Component {
  render() {
    return (
      <div className="list">
        {this.props.first.a.map((todo) => {
          return todo.name;
        })}
      </div>
    );
  }
}
